    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Resource Hog Demo</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            text-align: center;
            background-color: #f0f0f0;
            color: #333;
        }
        #status {
            margin: 20px 0;
            font-size: 1.5em;
            color: red;
        }
        #graph {
            width: 100%;
            height: 200px;
            background: lightgray;
            position: relative;
        }
        .bar {
            position: absolute;
            bottom: 0;
            width: 10px;
            background: green;
            transition: height 0.2s;
        }
    </style>
</head>
<body>
    <h1>Is Your App a Resource Hog?</h1>
    <div id="status">Memory Consumption: 0 arrays</div>
    <div id="graph"></div>
    
    <script>
        // Disable keyboard interactions
        document.addEventListener('keydown', function(event) {
            event.preventDefault();
        });

        // Create an array to hold memory allocations
        const memoryHog = [];
        const statusDiv = document.getElementById('status');
        const graphDiv = document.getElementById('graph');

        // Function to update the visual graph
        function updateGraph() {
            const bar = document.createElement('div');
            const height = Math.random() * 100; // Random height for demo
            bar.className = 'bar';
            bar.style.left = `${memoryHog.length * 12}px`; // Space out bars
            bar.style.height = `${height}px`;
            graphDiv.appendChild(bar);
        }

        // Function to generate a random number for added complexity
        function generateRandomNumber() {
            return Math.floor(Math.random() * 100);
        }

        // Function to log random numbers to simulate additional processing
        function logRandomNumbers() {
            for (let i = 0; i < 5; i++) {
                console.log("Random number:", generateRandomNumber());
            }
        }

        // Function to consume memory and CPU
        function consumeMemory() {
            // Continuously push large arrays into memoryHog
            const newArray = new Array(1e6).fill('*'); // 1 million elements
            memoryHog.push(newArray);
            statusDiv.textContent = `Memory Consumption: ${memoryHog.length} arrays`;
            updateGraph(); // Update graph with a new bar
            
            // Simulate CPU hogging with an intensive calculation
            for (let i = 0; i < 1e7; i++) {
                Math.sqrt(i); // This operation is CPU-intensive
            }

            logRandomNumbers(); // Log random numbers to console

            // Call the function again after a delay
            setTimeout(consumeMemory, 500); // Adjust delay as needed
        }

        // Function to demonstrate additional effects
        function additionalEffects() {
            const additionalElement = document.createElement('div');
            additionalElement.textContent = "This is an additional effect to show loading...";
            additionalElement.style.color = 'blue';
            additionalElement.style.marginTop = '20px';
            document.body.appendChild(additionalElement);
        }

        // Function to add more visual elements
        function addVisualElements() {
            for (let i = 0; i < 10; i++) {
                const visualElement = document.createElement('div');
                visualElement.textContent = `Element ${i + 1}`;
                visualElement.style.margin = '5px';
                visualElement.style.fontSize = '14px';
                visualElement.style.color = 'purple';
                document.body.appendChild(visualElement);
            }
        }

        // Start consuming memory and CPU
        consumeMemory();
        additionalEffects(); // Call the additional effects function
        addVisualElements(); // Call to add visual elements
    </script>
</body>
